import React, { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('http://localhost:8090/main/hello')
      .then(response => response.json())
      .then(data => {
        console.log(data);
        setMessage(data.message); // 백엔드에서 반환하는 데이터 형식에 따라 조정
      })
      .catch(error => console.error('Error fetching data: ', error));
  }, []);

  return (
    <div className="App">
      <h1>Hello World</h1>
      <p>{message}</p> {/* 백엔드에서 받은 메시지를 표시 */}
    </div>
  );
}

export default App;
